import React from 'react';
import './App.css';
import Navbar from './Navbar';
function Contact() {
  return (
        <>
        <Navbar/>
            <div className="my-5">
             <h1 className="text-center">Our Contacts</h1>


            </div>
            <div className="container-fluid">
              <div className="row">
                <div className="col-10 mt3">
                  <div className="row">
                    <div className="col-12">

                    </div>

                  </div>

                </div>

              </div>

            </div>


        </>

  );
}

export default Contact;
